import React from "react";
export default function Experince({
  title,
  subtitle,
  subtext2,
  subtext3,
  dark,
  id,
  img_src,
  img_src2,
}) {
  return (
    <div className={"section1" + (dark ? " section1-dark" : "")}>
      <div className="section1-content" id={id}>
        <h1>{title}</h1>
        <h2>Illinois Bussiness Consulting</h2>
        <img src={img_src} width="460"></img>
        <p className={"section1-text"}>{subtitle}</p>
        <h3></h3>
        <img classname="image1" src={img_src2} width="460" height="410"></img>
        <text className={"section1-text"}>
          {subtext2} {"\n"} {"\n"}
          {subtext3}
        </text>
      </div>
    </div>
  );
}
